> Pennsylvania Candidate attacks opponent for not arresting Cosby in 2005 FILE - In this file photo taken July 7, 2015, a member of the Montgomery County, Pa., board of commissioners and former district attorney of the county, Bruce L. Castor Jr., speaks during an interview with The Associated Press in Norristown, Pa. Castor is campaigning to become the county's district attorney again as the Republican nominee, but Democratic challenger Kevin Steele introduced a 30-second ad on Tuesday, Oct. 20, 2015, to remind voters that Castor declined to bring charges against entertainer Bill Cosby in 2005, after a former Temple University employee alleged Cosby drugged and sexually assaulted her. (AP Photo/Matt Rourke, File) 
